import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import AccountCircle from '@material-ui/icons/AccountCircle';
import LockIcon from '@material-ui/icons/Lock';
import { Box } from '@material-ui/core';
import transitions from '@material-ui/core/styles/transitions';

const useStyles = makeStyles((theme) => ({
  margin: {
    margin: theme.spacing(1),
    width: 350,
    height: 280,
    padding: 20,
    borderRadius: '5%',
    border: '1px solid rgba(255, 255, 255, 0.4)',
    borderRadius: '15px',
    backdropFilter: 'blur(5px)',
    background: 'radial-gradient(at 50% 0%, rgba(0,0,0,0), rgba(255,255,255,0.3))',
    boxShadow: '10px 10px 30px rgba(0,0,0,0.5)',
    transitions: 'all 0.3s ease-in-out',
    '&: hover': {
      transform: 'scale(1.05)',
      backdropFilter: 'blur(10px)',
      background: 'radial-gradient(at 50% 0%, rgba(0,0,0,0), rgba(255,255,255,0.3))',
      boxShadow: '10px 10px 30px rgba(0,0,0,0.5)',
    }
  },
}));

export default function InputWithIcon() {
  const classes = useStyles();

  return (
    <Box style={{ paddingLeft: 50, paddingTop: 20 }}>
      <Box className={classes.margin}>
        <Grid container spacing={1} alignItems="center" justify="center" >
          <h5 style={{ textAlign: 'center', fontFamily: "monospace", fontSize: '1rem'}}>Silver Bullet<br/>Welcome<br/> Please login!</h5>
          </Grid>
        <Grid container spacing={1} alignItems="flex-end" justify="center">
          <Grid item>
            <AccountCircle />
          </Grid>
          <Grid item>
            <TextField id="input-with-icon-grid-one" label="Username" />
          </Grid>
        </Grid>
        <Grid container spacing={1} alignItems="flex-end" justify="center">
          <Grid item>
            <LockIcon />
          </Grid>
          <Grid item>
            <TextField id="input-with-icon-grid-two" label="Password" />
          </Grid>
        </Grid>
      </Box>
    </Box>
  );
}
